import React from "react";
import Footer from "../components/Footer";
import NavigationBar from "../components/NavigationBar";
import WorksGallery from "../components/works/WorksGallery";

const Works = () => {
  return (
    <>
      <NavigationBar />
      <WorksGallery />
      <Footer />
    </>
  );
};

export default Works;
